import { default as express } from "express";
import { router as accountRoutes } from "./account.js";
import { router as profileRoutes } from "./profile.js";
import { router as userRoutes } from "./user.js";
import { router as ScanRoutes } from "./scan.js";
import { router as appointmentHoursRoutes } from "./appointmentHours.js";
import { router as appointmentRoutes } from "./appointment.js";
import { router as patientRoutes } from "./patient.js";
export const router = express.Router();
router.use("/account", accountRoutes);
router.use("/profile", profileRoutes);
router.use("/users", userRoutes);
router.use("/scans", ScanRoutes);
router.use("/appointment-hours", appointmentHoursRoutes);
router.use("/appointment", appointmentRoutes);
router.use("/patient", patientRoutes);
